import React from "react";
import { FormikProvider, FieldArray, getIn } from "formik";
import { Grid, Typography, Button } from "@mui/material";

import GoogleMaps from "./google-places-autocomplete";

const DeliveryForm = ({ formik, map, ...rest }) => {
  const [noOfDeliveries, setNoOfDeliveries] = React.useState(1);
  console.log(map);
  return (
    <React.Fragment>
      <FormikProvider value={formik}>
        <FieldArray name="deliveryDetails" error={formik.errors}>
          {({ remove, push }) => (
            <React.Fragment>
              <Grid container spacing={3} flex="center">
                <Grid item>
                  <Typography variant="h6">
                    No of Deliveries: {noOfDeliveries}
                  </Typography>
                </Grid>
                <Grid item>
                  <Button
                    sx={{ mb: 3 }}
                    variant="contained"
                    color="secondary"
                    onClick={() => {
                      setNoOfDeliveries(noOfDeliveries + 1);
                      push({ loading: "", unloading: "" });
                    }}
                  >
                    Add Delivery
                  </Button>
                </Grid>
              </Grid>

              {formik.values.deliveryDetails.length > 0 &&
                formik.values.deliveryDetails.map((delivery, index) => {
                  const loading = `deliveryDetails[${index}].loading`;
                  const touchedLoading = getIn(formik.touched, loading);
                  const errorLoading = getIn(formik.errors, loading);

                  const unloading = `deliveryDetails[${index}].unloading`;
                  const touchedUnloading = getIn(formik.touched, unloading);
                  const errorUnloading = getIn(formik.errors, unloading);

                  return (
                    <Grid
                      container
                      spacing={3}
                      className="row"
                      key={index}
                      alignItems={"center"}
                    >
                      <Grid item md={4} xs={12} className="col" key={index}>
                        <GoogleMaps
                          map={map}
                          error={errorLoading}
                          touched={touchedLoading}
                          name={loading}
                          setFieldValue={formik.setFieldValue}
                          handleBlur={formik.handleBlur}
                          values={formik.values}
                          index={index}
                          type="loading"
                          formik={formik}
                        />
                      </Grid>
                      <Grid item md={4} xs={12} className="col">
                        <GoogleMaps
                          error={errorUnloading}
                          touched={touchedUnloading}
                          name={loading}
                          setFieldValue={formik.setFieldValue}
                          handleBlur={formik.handleBlur}
                          values={formik.values}
                          index={index}
                          type="unloading"
                          formik={formik}
                        />
                      </Grid>
                      <Grid item md={4} xs={12} className="col">
                        <Typography variant="h6">240 Kms</Typography>
                      </Grid>
                      <Grid item className="col">
                        <Button
                          disabled={index < 1}
                          variant="contained"
                          color="secondary"
                          onClick={() => {
                            setNoOfDeliveries(noOfDeliveries - 1);
                            remove(index);
                          }}
                        >
                          Remove
                        </Button>
                      </Grid>
                    </Grid>
                  );
                })}
            </React.Fragment>
          )}
        </FieldArray>
      </FormikProvider>
    </React.Fragment>
  );
};

export default DeliveryForm;
